import { useLocation } from "react-router-dom";
import { useState } from "react";
import RecordingVideo from "../components/RecordingVideo";

export default function Game() {
    const location = useLocation();
    const { team = {}, players = [] } = location.state || {}; 
    const teamName = team.properties?.Name?.title?.[0]?.plain_text || "Unknown Team";

    const [data, setData] = useState([]);
    const [timestamps, setTimestamps] = useState([]);
    let logTimestamp = null;
    let uploadTimestamp = null;

    const handleCheckboxChange = (player) => {
        setData((prevData) => {
            if (prevData.some((p) => p.id === player.id)) {
                return prevData.filter((p) => p.id !== player.id);
            } else {
                return [...prevData, player];
            }
        });
    };

    return (
        <div className="page">
            <h1>{teamName}</h1>
            <p>Start Recording Game for {teamName}</p>

            <RecordingVideo setLogTimestamp={(func) => (logTimestamp = func)} 
                            setUploadTimestamp={(func) => (uploadTimestamp = func)} 
                            setTimestamps={setTimestamps} />

            <h2>Playing ({data.length})</h2>
            <p className="meta">Press the player button to timestamp highlight</p>

            <div style={{ display: "flex", flexDirection: "row", gap: "8px" }}>
                {data.map((player, index) => (
                    <div key={player.id || index}>
                        <button onClick={() => logTimestamp?.(index)} disabled={!logTimestamp}>
                            {player.properties?.Name?.title?.[0]?.plain_text}
                        </button>
                    </div>
                ))}
            </div>

            <button onClick={() => uploadTimestamp?.()} disabled={timestamps.length === 0}>
                Upload Timestamp
            </button>

            <hr/><br/><br/>

            <h2>Players ({players.length})</h2>
            <p className="meta">Choose players playing</p>

            <div style={{ display: "flex", flexDirection: "row", gap: "8px" }}>
                {players.map((item, index) => {
                    const playerName = item.properties?.Name?.title?.[0]?.plain_text || "Unnamed Player";
                    const backNumber = item.properties?.back_number?.rich_text?.[0]?.plain_text || "N/A";

                    return (
                        <div key={item.id || index} style={{ width: "100px", backgroundColor: "var(--black8)", padding: "8px" }}>
                            <p className="number">{backNumber}</p>
                            <p>{playerName}</p>
                            <input
                                type="checkbox"
                                onChange={() => handleCheckboxChange(item)}
                                checked={data.some((p) => p.id === item.id)}
                            />
                        </div>
                    );
                })}
            </div>
        </div>
    );
}
